import { FaInstagram, FaLinkedin } from "react-icons/fa";

const profiles = [
  { name: "John Doe", phone: "+1234567890", image: "https://via.placeholder.com/100" },
  { name: "Jane Smith", phone: "+1987654321", image: "https://via.placeholder.com/100" },
  { name: "Alice Brown", phone: "+1122334455", image: "https://via.placeholder.com/100" },
  { name: "Bob Johnson", phone: "+2233445566", image: "https://via.placeholder.com/100" },
  { name: "Charlie White", phone: "+3344556677", image: "https://via.placeholder.com/100" },
  { name: "Emma Green", phone: "+4455667788", image: "https://via.placeholder.com/100" }
];

function Contact() {
  return (
    <div className="flex flex-wrap justify-center gap-6 p-6">
      {profiles.map((profile, index) => (
        <div
          key={index}
          className="shadow-lg bg-white rounded-xl p-4 flex flex-col items-center w-64 border border-blue-400 shadow-blue-500/50"
        >
          <img src={profile.image} alt={profile.name} className="w-24 h-24 rounded-full mb-4" />
          <h2 className="text-lg font-semibold mb-2">{profile.name}</h2>
          <p className="text-gray-600 mb-4">{profile.phone}</p>
          <div className="flex gap-4">
            <a href="#" className="text-pink-500 text-2xl hover:text-pink-700">
              <FaInstagram />
            </a>
            <a href="#" className="text-blue-600 text-2xl hover:text-blue-800">
              <FaLinkedin />
            </a>
          </div>
        </div>
      ))}
    </div>
  );
}
export default Contact;
